import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Nav from './components/Nav';
//import { render } from "react-dom"
//import { BrowserRouter } from "react-router-dom"

import Homepage from './components/Homepage';
import reportWebVitals from './reportWebVitals';

import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,

  Link,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: (
      <div  className='nav-item my-3 w-28 '>
            <nav className="flex justify-center space-x-4">
                <Link to="/"><li className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Home</li></Link>

            </nav>
      </div>
    ),
  },
  {
    path: "about",
    element: <div>About</div>,
  },
]);


createRoot(document.getElementById("Nav_bar")).render(
  <RouterProvider router={router} />
);


/** 

