    <App />
  </BrowserRouter>,
  document.querySelector("#root")
)
**/




const home_ = ReactDOM.createRoot(document.getElementById('profile'));
home_.render(
  <React.StrictMode>
    <Homepage/>

  </React.StrictMode>
);

